import React from 'react';
import { Grid, Paper, Input } from '@material-ui/core';

const SignUp = () => {
  return (
    <Grid container justify='space-around'>
      <Paper>
        <Grid container justify='space-around'>
          <h1>Sign up</h1>
        </Grid>
        <Grid container justify="space-around">
          <form action="POST">
            <Grid container justify="space-around">
              <Input id="standard-basic" label="Standard"/>
            </Grid>
          </form>
        </Grid>
      </Paper>
    </Grid>
  );
};

export default SignUp;
